con:config.script:
import com.eviware.soapui.model.testsuite.TestCaseRunContext
import net.sf.json.groovy.JsonSlurper

//Check if the response
assert context.response, 'Response is empty or null'

log.info("context.response: " + context.response)

def jsonResonponse = new JsonSlurper().parseText(context.response)

tenantName = jsonResonponse[1].name
tenantId = jsonResonponse[1].id
if (tenantId) {
 log.info("Found tenant name: " + tenantName)	
 log.info("Found tenant id: " + tenantId)
 testRunner.testCase.testSuite.project.setPropertyValue( "tenantId", tenantId ) 
} else {
  testrunner.fail("Failed to get tenant")
  return
}

import com.eviware.soapui.model.testsuite.TestCaseRunContext
import net.sf.json.groovy.JsonSlurper

//Check if the response
assert context.response, 'Response is empty or null'

log.info("context.response: " + context.response)

def jsonResonponse = new JsonSlurper().parseText(context.response)

accessToken = jsonResonponse.access_token
if (accessToken) {
 log.info("Found access_token: " + accessToken)
 testRunner.testCase.testSuite.project.setPropertyValue( "bearerToken", accessToken ) 
} else {
  testrunner.fail("Failed to get token")
  return
}

